import React,{Component} from 'react'
import schema from '../Schema/Employee_form'
import ui_schema from '../Schema/employee_ui_schema'
import Form from "react-jsonschema-form";
import empl_deta from '../Schema/Empl_Deta';
import {Button} from "reactstrap";
import axios from 'axios'

export default class Employee_deta extends Component{
    constructor(props) {
        super(props)
        this.handleSubmit = this.handleSubmit.bind(this)
    }
    handleSubmit(formData){
        axios.post(
            'http://localhost:3000/posts',formData.formData)
            .then(res=>{console.log(res)})

    }
    render() {
        return(
                        <div className="bg-info">
                            <Form onSubmit={this.handleSubmit} liveValidate= {true} className= "container-fluid bg-inverse row text-white "  schema={schema} uiSchema={ui_schema}>
                                <Button color="primary" className= "btn-outline-success m-2">Submit</Button>
                            </Form>
                        </div>
        )
    }
}
